import React from "react";
import Auth from "./Auth";
import Home from "./Home";
import { Route, Link } from "react-router-dom"

function App() {

    return (
        <div className="app">
			<Route exact path="/" component={Home}/>
			<Route exact path="/auth" component={Auth}/>
        </div>
    );
}

export default App;
